function setValues() {
  const params = new URLSearchParams(window.location.search);
  let pAge = params.get("age");
  let age_unit = params.get("ageUnit");
  let psex = params.get("gender");
  let pbmi_unit = params.get("bmiUnit");
  let pbmi = params.get("bmi");

  nAge.selectedIndex = pAge;
  dd_age.selectedIndex = age_unit;
  gender.selectedIndex = psex;
  dd_bmi.selectedIndex = Number(pbmi_unit);
  bmi_in.value = pbmi;

}

